import React from 'react';
import {Link, NavLink} from 'react-router-dom'

function LogoImage(props) {

    return <NavLink exact activeClassName="active" to={`${process.env.PUBLIC_URL}/`} >
                <img src={`${process.env.PUBLIC_URL}/assets/images/icon/${props.logo}`} alt="" />
            </NavLink>;
}

export default LogoImage;
